import React, { Component } from 'react'
import Navbar from '../pages/Navbar'
import Body_Services from '../pages/Body_Services'

export class Services extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Body_Services />
      </div>
    )
  }
}

export default Services
